import React from "react";
import "./Education.css"

const Education = () => {
  return (
    <div className="Education">
      <div class="left">
          <h1>Purdue University</h1>
          <h2>2018-2022</h2>
          <h3>Bachelor of Science in Computer Engineering</h3>
      </div>

      <div class="right">
          <h2>John Doe</h2>
          <p>Some text here too.</p>
      </div>
    </div>
  );
};
export default Education;
